1A cava na vu ni veiba, kei na vu ni veivala e na kemuni maliwa? E sega li ni ra vu tiko mai na veimataqali gagadre ca ka ra veisaqasaqa tiko e na yagomuni? 2Ko ni dau gadreva na ka eso, ka sega ni rawata; ka ko ni sa via laba kina. Ko ni daukocova na ka eso, ia ka sega ni taukena rawa; ka ko ni sa veiba ka veivala kina. Ko ni sega ni rawata na veika ko ni gadreva baleta ni sega ni ko ni kerea vua na Kalou. 3Ko ni sa dau kerekere ka sega ni rawata, e baleta ni cala na i naki ni nomuni kerekere; 
..........
aka na yalomuni, o i kemuni na lomalomarua! 9Mo ni loma rarawa sara ka qoqolou, ka tagi! Me vuki na nomuni dredre me tagi kei na nomuni reki me lomabibi. 10Ni vakamalumalumutaki kemuni e na mata ni Turaga, ka na qai laveti kemuni cake ko koya. 11O i kemuni na wekaqu, ni kakua ni veikaseti vaka i kemuni. O koya yadua sa kaseta na wekana, sa kaseta na Lawa ka vakalewa na Lawa. Ia ke ko ni sa vakalewa na Lawa ko ni sa qai sega ni muria na Lawa ko ni sa kena turaganilewa ga. 12Sa dua bau na Vunilawa
